import React from 'react'
import styles from './PageTemplate.scss'
import classNames from 'classnames/bind';

const cx = classNames.bind(styles)

const PageTemplate = () => (
  <div className={cx('page-template')}>
    PAGE
  </div>

)

export default PageTemplate;
